import React from 'react'
import Card from './Card'
function Main({  setisLoggedin}) { 

  const handleLogout=()=>{
    setisLoggedin(true);
  }
  return (
    <>
    <div className="header">
        <h2>Redux Shopping App</h2>
        <h3>Cart:4 Items</h3>
        <button className='logoutBtn' onClick={handleLogout} >Logout</button>
    </div>
    <Card></Card>
    <p>Total :200$</p>
    <button className='logoutBtn' onClick={handleLogout} >Logout</button>
    </>
  )
}

export default Main
